import { useParams } from "react-router-dom";

function CoopSchedule()
{
    return(
        <div>
            <h1>Your Coop Schedule</h1>
            <table>
                <tr>
                    <th>Weekday</th>
                    <th>Subject</th>
                    <th></th>
                </tr>
                <tr>
                    <td>Weekday</td>
                    <td>Subject</td>
                    <td></td>
                </tr>
            </table>
            <button type="submit">Sign in</button>
        </div>
    )
}

export default CoopSchedule;
